import React, { Component } from 'react';
import * as ReactBootStrap from 'react-bootstrap';
import {Link} from 'react-router-dom';

class Navbar extends Component {
    render() {
        return (
            <div className="App">
                <div>
                    <ReactBootStrap.Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">

                        {/* <ReactBootStrap.Navbar.Brand href="#home">Personal Expense Wallet</ReactBootStrap.Navbar.Brand> */}
                        <ReactBootStrap.Navbar.Toggle aria-controls="responsive-navbar-nav" />
                        <ReactBootStrap.Navbar.Collapse id="responsive-navbar-nav">
                            <ReactBootStrap.Nav className="me-auto">
                                <Link>
                                <ReactBootStrap.Nav.Link to="/Wallet">Wallet Panel</ReactBootStrap.Nav.Link>
                                </Link>
                            </ReactBootStrap.Nav>
                            <ReactBootStrap.Nav>
                                <ReactBootStrap.Navbar.Brand href="index.html" style={styles}>Personal Expense Wallet</ReactBootStrap.Navbar.Brand>
                            </ReactBootStrap.Nav>
                            <ReactBootStrap.Nav>
                                <ReactBootStrap.NavDropdown title="Sign in options" id="collasible-nav-dropdown">
                                    <ReactBootStrap.NavDropdown.Item href="register.html">Sign up/ Register</ReactBootStrap.NavDropdown.Item>
                                    <ReactBootStrap.NavDropdown.Item href="login.html">Sign in</ReactBootStrap.NavDropdown.Item>
                                </ReactBootStrap.NavDropdown>
                            </ReactBootStrap.Nav>
                        </ReactBootStrap.Navbar.Collapse>

                    </ReactBootStrap.Navbar>
                </div>
            </div>

        )
    }
}

const styles = {
    marginRight: 500   
}
export default Navbar
